import React from "react";
import question from "./Api";
import "./index.css";
import Accordion from "./Accordion";

let App = () =>{
    return(
        <>
        
        <section className="Main_Div">

        {question.map((CurValue, Index)=>{
            return(
               <>
                 <Accordion key={CurValue.id} {...CurValue}/>
               </>
            )

        })}

        </section>
       
        

        </>
    )

}

export default App;
